import React, { Component } from 'react'
import Header from '../components/header/Header'

class Landing extends Component {
    render() {
        return (
            <div>
                <Header />
                <h2 id="slogan">Where teams <span>design together</span></h2>
                
            </div>
        )
    }
}

export default Landing
